import React from 'react';

import CustomHeader from './Header.js'
import { Layout } from 'antd';
const { Header, Footer, Content } = Layout;

class Home extends React.Component {
  render() {
    return (
      <Layout>
        <Header>
          <CustomHeader/>
        </Header>
        <Content style={{background: "#d64f6d"}}>
          <span style={{ fontWeight: '900', color: 'white', fontSize: '100px'}}>Mobile App Developer</span>
        </Content>
        <Content style={{background: "#b20c30"}}>

        </Content>
        <Footer>Footer</Footer>
      </Layout>
    )
  }
}

export default Home;
